import React from 'react';
import styled from 'styled-components/macro';

import CategoryButton from './CategoryButton.js';
import categories from './data/categories.js';

// import Overlay from './Overlay.js';

export default function CategoryButtons ({ children }, props) {

  function handleChange(event) {
    props.onChange(event.target.value);
  }

  return (
    <div>
      <Spacer />
        <CategoryButtonArea>
          <CategoryButton value={props.value} onChange={handleChange}>{categories[0]}</CategoryButton>
          <CategoryButton value={props.value} onChange={handleChange}>{categories[1]}</CategoryButton>
          <CategoryButton value={props.value} onChange={handleChange}>{categories[2]}</CategoryButton>
          <CategoryButton value={props.value} onChange={handleChange}>{categories[3]}</CategoryButton>
          <CategoryButton value={props.value} onChange={handleChange}>{categories[4]}</CategoryButton>
          <CategoryButton value={props.value} onChange={handleChange}>{categories[5]}</CategoryButton>
          <CategoryButton value={props.value} onChange={handleChange}>{categories[6]}</CategoryButton>
          <CategoryButton value={props.value} onChange={handleChange}>{categories[7]}</CategoryButton>
          <CategoryButton value={props.value} onChange={handleChange}>{categories[8]}</CategoryButton>
          <CategoryButton value={props.value} onChange={handleChange}>{categories[9]}</CategoryButton>
          <CategoryButton value={props.value} onChange={handleChange}>{categories[10]}</CategoryButton>
          <CategoryButton value={props.value} onChange={handleChange}>{categories[11]}</CategoryButton>
          <CategoryButton value={props.value} onChange={handleChange}>{categories[12]}</CategoryButton>
          <CategoryButton value={props.value} onChange={handleChange}>{categories[13]}</CategoryButton>
          <CategoryButton value={props.value} onChange={handleChange}>{categories[14]}</CategoryButton>
        </CategoryButtonArea>
    </div>
  )
}

const CategoryButtonArea = styled.div`
  display: grid;
  color: white;
  grid-template-rows: 1fr 1fr 1fr 1fr 1fr;
  grid-template-columns: 1fr 1fr 1fr;
  justify-items: center;
  gap: 30px 20px;
  margin-top: 20vw;
  margin-bottom: 10vw;
  background-color: rgba(0,0,0,0);
`

const Spacer = styled.div`
  height: 10vw;
  opacity: 0;
`
